import React, { Component } from 'react';
import {
  BrowserRouter as Router,
  Route,
} from 'react-router-dom';
import TopAds from './components/TopAds';
import './css/App.css';

class App extends Component {
  render() {
    return (
      <Router>
        <div className="App">
          <Route path="/" component={TopAds} exact />
        </div>
      </Router>
    );
  }
}

export default App;
